import React from 'react';
import {Link} from 'react-router-dom';
import AddShoppingCart from '@material-ui/icons/AddShoppingCartSharp';
import EmojiObjects from '@material-ui/icons/EmojiObjectsSharp';
/*import {Construction} from '@material-ui/icons/Construc'; It is not yet inclded with existing material-ui package*/
import SvgIcon from '@material-ui/core/SvgIcon';
import Business from '@material-ui/icons/BusinessSharp';
import { BusinessSharp } from '@material-ui/icons';
import Build from '@material-ui/icons/BuildSharp';
import Construction from './construction-black-18dp.svg';

function constructionIcon(){
    return(
        <SvgIcon component={Construction}/>
    )
}

function Header(){
    return(
            <div class="header">
                
                <div class="inner_header">
                    
                    <div class="logo_container">
                        <a><Link to="/">MY<span class="logo_part">APP</span></Link></a>
                    </div>

                <ul class="navigation">
                    <li><a><Link to="/products"><AddShoppingCart/>Produkte</Link></a></li>
                    <li><a><Link to="/solutions"><EmojiObjects/>LÃ¶sungen</Link></a></li>
                    <li><a><Link to="/tools">{constructionIcon()}Tools</Link></a></li>
                    <li><a><Link to="/tools"><BusinessSharp/>Unternehmen</Link></a></li>
                </ul>
            </div>
            
            </div>
            )
}
export default Header;
